import React from "react";
import { BackgroundDiv } from "./index";

const HomePage = () => {
  return <BackgroundDiv>
    <h1>Oi</h1>
      <div>
        <input
          type="text"
          placeholder="Nome"
          value={nome}
          onChange={(e) => setNome(e.target.value)}
        />
        </div>
        <div>
        <input
          type="text"
          placeholder="CPF"
          value={cpf}
          onChange={(e) => setCpf(e.target.value)}
        />
        <div>
          <button onClick={() => criarDado(cpf, nome)}>Criar dado</button>
        </div>
      </div>
  </BackgroundDiv>;
};

export { HomePage };
